import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

const UserComplaints = ({ user_id }) => {
  const [complaints, setComplaints] = useState([]);

  useEffect(() => {
    const getUserComplaints = async () => {
      try {
        const response = await axios.get(`http://localhost:5000/user/${user_id}/complaints`);
        setComplaints(response.data.complaints);
      } catch (error) {
        console.error(error);
      }
    };
    getUserComplaints();
  }, [user_id]);

  return (
    <div>
      <h1>Kullanıcı Arızaları</h1>
      <table>
        <thead>
          <tr>
            <th>Arıza No</th>
            <th>Başlık</th>
            <th>Statü</th>
            <th>Detayları Gör</th>
          </tr>
        </thead>
        <tbody>
          {complaints.map((complaint) => (
            <tr key={complaint[0]}> {/* Assuming complaint[0] is the unique identifier (id) */}
              <td>{complaint[0]}</td>
              <td>{complaint[2]}</td>
              <td>{complaint[5]}</td>
              <td>
                <Link to={`/complaint/${complaint[0]}`}>Detayları Gör</Link>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default UserComplaints;
